(function ($, Drupal) {
  'use strict';
  // This behaviors will align the notifications view to center when recommended block is not available.
  Drupal.behaviors.footermenu = {
    attach: function (context, settings) {
      $('.mobile-nav-title .trigger').on('click', function (e) {
        if ($(this).attr('aria-expanded') === 'false') {
          $(this).closest('.mobile-nav-wrapper').focus();
          $(this).attr('aria-expanded', true);
          $(this).find('.icon-expand').hide();
          $(this).find('.icon-collapse').show();
          $(this).closest('.mobile-nav-wrapper').find('.mobile-nav').slideDown('fast', function () {
            $(this).closest('.mobile-nav-wrapper').focus();
          });
        }
        else if ($(this).attr('aria-expanded')) {
          $(this).attr('aria-expanded', false);
          $(this).find('.icon-expand').show();
          $(this).find('.icon-collapse').hide();
          $(this).parents('.mobile-nav-wrapper').find('.mobile-nav').slideUp('fast');
          $(this).parents('.mobile-nav-wrapper').focus();
        }
      });

      $('.icon-hamburger').on('click', function (e) {
        if ($(this).attr('aria-expanded') === 'false') {
          $(this).attr('aria-expanded', true);
          $('.menu--main__collapse').slideDown();
          $(this).find('.svg-hamburger-dims').hide();
          $(this).find('.svg-hamburger-x-dims').show();
        }
        else {
          $(this).attr('aria-expanded', false);
          $('.menu--main__collapse').slideUp();
          $(this).find('.svg-hamburger-dims').show();
          $(this).find('.svg-hamburger-x-dims').hide();
        }
      });

      // colse haburger menu when click on window or out side of menu icon
      $(window).bind('click', function (e) {
        if (!$(e.target).closest('a').hasClass('icon-hamburger') && $('.icon-hamburger').is(':visible')) {
          $('.menu--main__collapse').attr('aria-expanded', false);
          $('.menu--main__collapse').slideUp();
          $('.icon-hamburger').find('.svg-hamburger-dims').show();
          $('.icon-hamburger').find('.svg-hamburger-x-dims').hide();
        }
      });

      $('.terms-conditions__button').on('click', function () {
        var printContents = $('.terms-conditions__wrapper').html();
        var originalContents = document.body.innerHTML;
        document.body.innerHTML = printContents;
        window.print();
        document.body.innerHTML = originalContents;
      });
    }
  };
})(jQuery, Drupal);
